function show_62ae8049(evt, text) {
	var pos = (evt.target.getAttribute("y") < 530) ? "bottom" : "top";
	var note = document.getElementById(pos + "_note_62ae8049");
	note.textContent = text;
	note.setAttributeNS(null, "visibility", "visible");
	document.getElementById(pos + "_overlay_62ae8049").setAttributeNS(null, "visibility", "visible");
}
function hide_62ae8049(evt) {
	document.getElementById("top_note_62ae8049").setAttributeNS(null, "visibility", "hidden");
	document.getElementById("top_overlay_62ae8049").setAttributeNS(null, "visibility", "hidden");
	document.getElementById("bottom_note_62ae8049").setAttributeNS(null, "visibility", "hidden");
	document.getElementById("bottom_overlay_62ae8049").setAttributeNS(null, "visibility", "hidden");
}
